import numpy as np
import pandas as pd
from lib import utils

group_path = utils.get_relative_file('groups', 'group_k_means_split_by_date.json')
groups = utils.load_json(group_path)


def get_name(_eco_label):
    if _eco_label == 1:
        return 'core'
    elif _eco_label == 2:
        return 'peri'
    else:
        return 'IDB'


data = np.array(pd.read_csv(utils.get_relative_file('runtime', 'TRACE_cluster_lag.csv')))
data = data[:, 1:4]

d = {}
for l in data:
    _id = str(l[0])
    month = l[1]
    if month[:len('2015')] != '2015':
        continue

    _label = l[2]
    if _id not in d:
        d[_id] = {}
    if _label not in d[_id]:
        d[_id][_label] = 0
    d[_id][_label] += 1

eco_data = []

new_d_id_2_eco_label = {}

for _id, val in d.items():
    _l = list(val.items())
    _l.sort(key=lambda x: x[1], reverse=True)
    _l = _l[0]
    name = get_name(_l[0])

    new_d_id_2_eco_label[_id] = name

    eco_data.append([_id, name])

    if _id not in groups:
        if name == 'IDB':
            print(f'### missing id: {_id} {name}')
        continue

    groups[_id] = {
        'origin': int(groups[_id]),
        'core_peri_idb': name,
    }

utils.write_json(utils.get_relative_file('runtime', 'd_dealer_index_2_eco_label.json'), new_d_id_2_eco_label)
exit()

for k, v in groups.items():
    if not isinstance(v, dict):
        v = {
            'origin': int(v),
            'core_peri_idb': 'unknown',
        }
        groups[k] = v

# 1 for core dealers, 2 for peripheral ones and 3) for IDB.
print('\n---------------------------------')
print(groups)

# utils.write_json(utils.get_relative_file('runtime', 'k_means_4_cluster_labels.json'), groups)

print('\ndone')

group_data = list(map(lambda x: x[1], groups.items()))

print(f"total: {len(eco_data)}")
print(f"core: {len(list(filter(lambda x: x[1] == 'core', eco_data)))}")
print(f"peripheral: {len(list(filter(lambda x: x[1] == 'peri', eco_data)))}")
print(f"IDB: {len(list(filter(lambda x: x[1] == 'IDB', eco_data)))}")

print(f'\ntotal: {len(group_data)}')
print(f"core: {len(list(filter(lambda x: x['core_peri_idb'] == 'core', group_data)))}")
print(f"peripheral: {len(list(filter(lambda x: x['core_peri_idb'] == 'peri', group_data)))}")
print(f"IDB: {len(list(filter(lambda x: x['core_peri_idb'] == 'IDB', group_data)))}")
print(f"unknown: {len(list(filter(lambda x: x['core_peri_idb'] == 'unknown', group_data)))}")


def freq_level(x):
    x = int(x)
    if x == 2:
        return 'most'
    elif x == 1:
        return 'more'
    elif x == 0:
        return 'less'
    else:
        return 'least'


